import React from "react";
import Proptypes from "prop-types";

function Food({ name, picture, rating }) {
  return (
    <div>
      <h1>{name}</h1>
      <h4>{rating}/5.0</h4>
      <img src={picture} alt={name} />
    </div>
  );
}

Food.propTypes = {
  name: Proptypes.string.isRequired,
  picture: Proptypes.string.isRequired,
  rating: Proptypes.number.isRequired,
};

const foodILike = [
  {
    id: 1,
    name: "kimchi1",
    image:
      "data:image/jpeg;base64,",
    rating: 5,
  },
  {
    id: 2,
    name: "kimchi2",
    image:
      "data:image/jpeg;base64,",
    rating: 4.9,
  },
];

function App() {
  return (
    <div>
      <h1>Test</h1>
      {foodILike.map((dish) => (
        <Food
          key={dish.id}
          name={dish.name}
          picture={dish.image}
          rating={dish.rating}
        />
      ))}
    </div>
  );
}

export default App;
